import Svg, { Path, Circle } from 'react-native-svg';

export const IconLocalLibrarySolid = props => (
  <Svg
    width={22}
    height={22}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    {...props}
  >
    <Circle cx="9" cy="4" r="4" fill={Colors.HERO_BLUE} />
    <Path
      d="M9,10.6C6.6,8.4,3.5,7,0,7v11c3.5,0,6.6,1.4,9,3.5c2.4-2.2,5.5-3.5,9-3.5V7C14.5,7,11.4,8.4,9,10.6z"
      fill={Colors.HERO_BLUE}
    />
  </Svg>
);

export default IconLocalLibrarySolid;
